(127, 1, '2022-02-09 22:18:04', '2022-02-09 19:18:04', '', 'Виктория Герман', 'Обратилась в компанию Нептун за уборкой после капитального ремонта. Проехали двое человек, со своей техников, моющим инвентарем и средствами. Честно, очень довольна работой, намыли на совесть. Лично от себя могу сказать только положительное. По времени справились достаточно оперативно, претензий никаких после осмотра нет никаких', 'trash', 'closed', 'closed', '', '%d0%b2%d0%b8%d0%ba%d1%82%d0%be%d1%80%d0%b8%d1%8f-%d0%b3%d0%b5%d1%80%d0%bc%d0%b0%d0%bd__trashed', '', '', '2022-02-09 23:16:48', '2022-02-09 20:16:48', '', 0, 'http://gruz/?post_type=reviews&#038;p=127', 0, 'reviews', '', 0),
(128, 1, '2022-02-09 22:17:56', '2022-02-09 19:17:56', '', 'review1', '', 'inherit', 'open', 'closed', '', 'review1', '', '', '2022-02-09 22:17:56', '2022-02-09 19:17:56', '', 127, 'http://gruz/wp-content/uploads/2022/02/review1.png', 0, 'attachment', 'image/png', 0),
(129, 1, '2022-02-09 22:19:24', '2022-02-09 19:19:24', '', 'Петр Анохин', 'Уборка квартиры была выполнена качественно это самое главное! Ребята очень внимательные, четко следуют всем пожеланиям, не оставляют без внимания мелкие детали. После уборки в квартире было ощущение чистоты и свежести. Да и в целом ребята приятные в общении, что немаловажно, когда приглашаешь людей в свой дом', 'publish', 'closed', 'closed', '', '%d0%bf%d0%b5%d1%82%d1%80-%d0%b0%d0%bd%d0%be%d1%85%d0%b8%d0%bd', '', '', '2022-02-09 22:57:56', '2022-02-09 19:57:56', '', 0, 'http://gruz/?post_type=reviews&#038;p=129', 0, 'reviews', '', 0),
(130, 1, '2022-02-09 22:19:38', '2022-02-09 19:19:38', '', 'review2', '', 'inherit', 'open', 'closed', '', 'review2', '', '', '2022-02-09 22:19:38', '2022-02-09 19:19:38', '', 129, 'http://gruz/wp-content/uploads/2022/02/review2.png', 0, 'attachment', 'image/png', 0),
(131, 1, '2022-02-09 22:22:37', '2022-02-09 19:22:37', '', 'Екатерина Владимировна', 'Уборка выполнена на 5+. Заказывали услуги сначала для одной квартиры но сейчас перешли на постоянную уборку двух квартир. К работе подход добросовестный, оттирается все что прошлые клинеры не могли оттереть, в основном в душевой комнате. Вообщем очень рады что выбрали компанияю Нептун  и планируем обращаться вновь!', 'publish', 'closed', 'closed', '', '%d0%b5%d0%ba%d0%b0%d1%82%d0%b5%d1%80%d0%b8%d0%bd%d0%b0-%d0%b2%d0%bb%d0%b0%d0%b4%d0%b8%d0%bc%d0%b8%d1%80%d0%be%d0%b2%d0%bd%d0%b0', '', '', '2022-02-09 22:58:38', '2022-02-09 19:58:38', '', 0, 'http://gruz/?post_type=reviews&#038;p=131', 0, 'reviews', '', 0),
