(133, 1, '2022-02-09 22:24:28', '2022-02-09 19:24:28', '', 'Виктория Герман', 'Обратилась в компанию Нептун за уборкой после капитального ремонта. Проехали двое человек, со своей техников, моющим инвентарем и средствами. Честно, очень довольна работой, намыли на совесть. Лично от себя могу сказать только положительное. По времени справились достаточно оперативно, претензий никаких после осмотра нет никаких', 'publish', 'closed', 'closed', '', '%d0%b2%d0%b8%d0%ba%d1%82%d0%be%d1%80%d0%b8%d1%8f-%d0%b3%d0%b5%d1%80%d0%bc%d0%b0%d0%bd-2', '', '', '2022-02-09 23:15:59', '2022-02-09 20:15:59', '', 0, 'http://gruz/?post_type=reviews&#038;p=133', 0, 'reviews', '', 0),
(134, 1, '2022-02-09 22:58:23', '2022-02-09 19:58:23', '', 'Екатерина Владимировна', 'Уборка выполнена на 5+. Заказывали услуги сначала для одной квартиры но сейчас перешли на постоянную уборку двух квартир. К работе подход добросовестный, оттирается все что прошлые клинеры не могли оттереть, в основном в душевой комнате. Вообщем очень рады что выбрали компанияю Нептун', 'inherit', 'closed', 'closed', '', '131-autosave-v1', '', '', '2022-02-09 22:58:23', '2022-02-09 19:58:23', '', 131, 'http://gruz/?p=134', 0, 'revision', '', 0),
